import re
import logging
import json

# Configure logging
logging.basicConfig(filename='submission.log', level=logging.INFO, format='%(asctime)s - %(levelname)s - %(message)s')

class Submission:
    def __init__(self, submission_id):
        self.submission_id = submission_id
        self.publish_status = 'draft'
        self.errors = []

    def update_publish_status(self, new_status):
        self.publish_status = new_status
        logging.info(f'Submission {self.submission_id} status updated to {self.publish_status}')

    def log_error(self, error_message):
        self.errors.append(error_message)
        logging.error(f'Error in Submission {self.submission_id}: {error_message}')

class FileManager:
    SUPPORTED_FORMATS = ['pdf', 'docx', 'xlsx']

    @staticmethod
    def validate_file_format(filename):
        file_extension = filename.split('.')[-1]
        if file_extension in FileManager.SUPPORTED_FORMATS:
            logging.info(f'File {filename} format is valid.')
            return True
        else:
            logging.warning(f'File {filename} format is invalid. Supported formats: {FileManager.SUPPORTED_FORMATS}')
            return False

class ValidationService:
    @staticmethod
    def validate_duns_number(duns_number):
        if re.match(r'^\d{2}-\d{7}-\d{4}$', duns_number):
            logging.info(f'DUNS number {duns_number} is valid.')
            return True
        else:
            logging.warning(f'DUNS number {duns_number} is invalid.')
            return False

class Logger:
    @staticmethod
    def log_event(event_message):
        logging.info(event_message)

class DataUser:
    def __init__(self):
        self.records = {}

    def update_record(self, record_id, new_data):
        self.records[record_id] = new_data
        logging.info(f'Record {record_id} updated with data: {new_data}')

    def get_updates(self):
        return self.records

class UIReport:
    @staticmethod
    def share_report(report_data, filename='report.json'):
        with open(filename, 'w') as report_file:
            json.dump(report_data, report_file)
        logging.info(f'Report shared: {filename}')

# Example usage
if __name__ == '__main__':
    submission = Submission(submission_id=1)
    submission.update_publish_status('published')

    file_manager = FileManager()
    file_manager.validate_file_format('document.pdf')

    duns_valid = ValidationService.validate_duns_number('12-3456789-0001')

    data_user = DataUser()
    data_user.update_record('record_1', {'status': 'active', 'owner': 'user_123'})

    report_data = {'submissions': [submission.publish_status], 'records': data_user.get_updates()}
    UIReport.share_report(report_data)
